const AboutText = [
  'Marc Munic has had a wide array of various careers through out his life.  The only career he ever really wanted was to be a software programmer.  After enlisting in the US Navy after 9/11, he did not expect he would ever be able to be a professional programmer.',
  'Marc has always stayed busy.  While working at Bridgepoint Education, he finished his BA.  While working as a Poltical Consultant, he sat on various boards ranging from public to private.  While working at Mt. Soledad National Veterans Memorial, he was able to finally pursue his passion, and attended the UCSD Full Stack Developer program.  He started working as a Software Developer for Zeeto.io within a month of completing the course.',
  "He started working at Forcepoint as a Software Engineer I and within less than 6 months was promoted to Software Engineer II.  Projects started on the front end with React and introduced the importance of global state management and Redux.  Went on to managing a login page that utilized Okta's SSO and AWS's Cognito.  Ended with writing an Explicit Proxy that was written in Go and tested with a Python framework called Robot",
  'I stay busy in San Diego with my wife, my son, and my dog.',
];

export default AboutText;
